import React from "react";
function Footer() {
  const style = {
    color: "red",
    fontSize: "32 px",
    margin: "auto"
  }
  return (
  
    <div>
      <br />
      <hr></hr>
      <footer style={style}>This is my footer.</footer>
    </div>
  );
}

export default Footer;
